This 45-minute practice includes a combination of flowing movements, yoga postures, breathing techniques and guided relaxation / meditation.

The breath moves through your joints, muscles, bones and organs, as you stretch away your stress, tension, tightness, discomfort and pain.

Lyn's amazingly soothing voice guides you through a lengthy guided relaxation which takes you into a peaceful and calm state of being.

Filmed on location at exquisite Lord Howe Island, NSW, Australia.
